import React from "react";
import Markdown from "markdown-to-jsx";
import { Button, Card, CardContent } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { ArrowBack } from '@material-ui/icons';

const Hem = () => {

    const useStyles = makeStyles({
        container: {
            padding: "0",
            margin: "0"
        },
        buttonCard : {
          marginLeft: "10px",
          marginTop: "10px",
          size: "small",
          borderRadius: "20px",
          backgroundColor: "rgb(51,51,51, 0.2)"
          
        },
        sectionTop : {
          display: "flex",
          flexDirection: "row",
          padding: "0",
          

        },
        sectionMain : {
            padding: "0",
            margin: "-10px",
          },
      })

      const classes = useStyles();
    return (
    <div>
         <Card>
                <CardContent className={classes.sectionTop}>
                    <Button onClick={event => window.location.href='/posts/'} className={classes.buttonCard}><ArrowBack/></Button>
                </CardContent>

                <CardContent className={classes.sectionMain}>
                    <Markdown>
Hej
                    </Markdown>
                </CardContent>
            </Card>
    </div>
    )
    
}

export {Hem}
